INSERT INTO `cake` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact_number`, `email`, `website`) VALUES
(1, 'House of Cakes', 'House of Cakes is a wedding baking company in Rathnapura. Using only the finest ingredients, owner and self-taught cake designer Nishki Perera specializes in crafting exquisite wedding cakes that are both stylish and sumptuous. Creative and passionate, she is ready to help you design the perfect cake to commemorate your once-in-a-lifetime celebration.', '5000.00', , '0779069892', 'houseofcakes@gmail.com', 'https://www.house-of-cakes.com');
INSERT INTO `cake` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact_number`, `email`, `website`) VALUES
(2, 'Dec-O-Cake', 'Dec-O-Cake, is a bakery in Dehiwala that specializes in crafting beautiful, memorable and one-of-a-kind wedding and special occasion cakes. Choose from over 120 cake styles and an extensive list of filling options, or work with their wedding cake specialists to custom-design a cake that matches your event style and needs. For over 40 years, Dec-O-Cake has expertly crafted cakes that are delicious, personalized and sure to exceed your every expectation.\r\n', '6500.00', , '0715544909', 'decocake.sr@gmail.com', 'https://www.facebook.com/Decocake.sr/');
INSERT INTO `cake` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact_number`, `email`, `website`) VALUES
(3, 'Yeli\'s Sugar Creations', 'At Yeli\'s Sugar Creations, I guarantee that my cakes are always made fresh and made by me, Yeli, from scratch! Nothing out of my kitchen gets stored in a freezer to wait for your event.\r\nPlease feel free to check out my photos! You\'ll see that I offer all sorts of items from wedding cakes and grooms cakes to cupcakes, cake pops, and petit-fours, so feel free to check my availability for all of your engagement and bridal showers in addition to the big day!', '4500.00', , '0777227190', 'yelissugarcreations@gmail.com', 'https://www.facebook.com/yelissugarcreations/'),
(4, 'Voila Cakes', 'Voila Cakes offers design consultations with couples to craft a personalized plan for their wedding. They take care of all the display needs, including jars, scoops, tongs, candy carts, love tables, donut walls, and cake-pop stands. All candies are exclusively ordered for the couple\'s wedding day to ensure its quality and freshness. Voila Cakes also offers gluten-free, sugar-free, and kosher treats to meet various dietary needs. On the day of the wedding, they take care of delivery, set up, and clean up for a stress-free experience. \r\n', '5000.00', , '0771592591', 'voilacakes123@gmail.com', 'https://www.facebook.com/voilacakessrilanka/');
INSERT INTO `cake` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact_number`, `email`, `website`) VALUES
(5, 'Darlos Bakes Art', 'Darlos Bakes Art is dedicated to offering confections at affordable prices. Their cakes come in a variety of shapes, forms, and complexities to accommodate a wide range of budgets. A custom creation with their team begins with a friendly meeting and transitions into serving a couple\'s dream wedding cake at their event. Available flavors include vanilla, chocolate, strawberry, cookie butter, coconut, and lemon. In addition to bespoke orders, couples can also exploreDarlos Bakes Art\'s readymade goods. These may include options such as delicious jumbo cowboy cookies or grab-and-go half-dozen cookie boxes.', '5500.00', , '0777590204', 'darlosbakersart@gmail.com', 'https://www.facebook.com/darlosbakersart/');
INSERT INTO `cake` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact_number`, `email`, `website`) VALUES
(6, 'Cake Villa', 'The Cake Villa works with couples to bring them the candy that they enjoy most. After an initial meeting, they will stock everything you like in the truck, delivering it straight to your venue. Their truck arrives at least half an hour before needed, and an attendant will stay throughout their stay to give recommendations and assistance to your guests. They can also provide custom bags to hold all your treats, or, if you prefer, they can use your own, personalized bags. This company usually services the Colombo area, but they are happy to travel further upon request.', '6500.00', , '0774703512', 'zuvicakevilla@gmail.com', 'https://www.facebook.com/CakeVillaLK/\r\n');
INSERT INTO `cake` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact_number`, `email`, `website`) VALUES
(7, 'Sugar craft Cake Design', 'With Sugar craft Cake Design, you can look forward to wedding desserts designed with love. Max and Heather host private tasting events at their brick-and-mortar location, where you can decide if they are the right fit for your day. After that, you can get to work designing your ideal cake with their help. They pride themselves in creativity and using top-quality ingredients in each of their confections. They can also adapt recipes to adhere to any dietary restrictions you may have. All delivery and set up can be managed by the team, allowing you to enjoy your delicious desserts to the fullest.\r\n', '6300.00', , '0716774545', 'sugarcraft87@yahoo.com', 'https://www.facebook.com/Sugar-craft-cake-des\r\n');
INSERT INTO `cake` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact_number`, `email`, `website`) VALUES
(8, 'Divine Cakes', 'Divine Cakes collaborates with clients in the design process, offering consultations to discuss their tastes and style preferences. This bakery offers an incredible range of flavors for clients to choose from, including chocolate, red velvet, and carrot. Fillings range from classic vanilla buttercream to German chocolate and whipped cream. Vegan and gluten-free cake options are also available. In addition to wedding cakes, this team can offer a variety of desserts for couples and their guests to enjoy,\r\n', '7500.00', , '0112583598', 'info@divine.lk', 'http://www.divine.lk/\r\n'),
(9, 'Cake N Bake', 'Cake N Bake whips up delectable jarred desserts and bakes tantalizing cakes and cupcakes in a wide variety of luscious flavors. They offer couples customized cake designs and taste combinations to best suit their special occasion. For a flawless planning experience, this company provides consultations and tastings prior to the big day. You can count on this team to arrive promptly to deliver, setup, and cleanup your display for hassle-free service and a sweet celebration.\r\n', '6400.00', , '0771228711', 'cakenbakelk@yahoo.co.uk', 'https://www.facebook.com/cakenbake.wattala/');
INSERT INTO `cake` (`vendor_ID`, `business_name`, `description`, `price`, `company_image`, `contact_number`, `email`, `website`) VALUES
(10, 'The Cake Bar', 'Every one of The Cake Bar\'s cakes is made from scratch. The ingredients that go into these creations are sourced locally and ensured to be both fresh and of good quality. Each cake layer is meticulously matched to the next, molded together with delicious swiss meringue buttercream. Ideal for couples who have balanced tastes and desire a cake that is not too sweet, but just sweet enough, this bakery is prepared to deliver.\r\n', '5500.00', , '0766656101', 'thecakebar.lk@facebook.com', 'https://www.facebook.com/thecakebar.lk/');

